import React from 'react';
import Player from 'video-react';

import './video-item.styles.scss';

const VideoItem = ({imageUrl,Player}) => (
	<div className='video-item'>
		<div
			className='video'
			  style={{
				backgroundImage:`url(${imageUrl, Player})`
			}}
		/>
	</div>
)

export default VideoItem;
